using System.Numerics;
using Nethereum.ABI.FunctionEncoding.Attributes;
using Nethereum.Contracts;

namespace Nethereum.BlockchainProcessing.InMemory.Console
{
    [Function("buyApprenticeChest")]
    public class BuyApprenticeFunction: FunctionMessage
    {
        [Parameter("uint256", "_region", 1)]
        public BigInteger Region { get; set; }
    }

    [Function("openChest")]
    public class OpenChestFunction: FunctionMessage
    {
        [Parameter("uint256", "_identifier", 1)]
        public BigInteger Identifier { get; set; }
    }

    //address _emitter, address _administrator, address _gameCoin, uint256 _openingTime, uint256 _closingTime
    public class GlitchGoonsItemConstructor: ContractDeploymentMessage
    {
        private const string ContractByteCode = "";


        public GlitchGoonsItemConstructor() : base(ContractByteCode)
        {
        }

        [Parameter("address", "_emitter", 1)]
        public string Emitter { get; set; }

        [Parameter("address", "_administrator", 1)]
        public string Administrator { get; set; }

        [Parameter("address", "_gameCoin", 1)]
        public string GameCoin { get; set; }

        [Parameter("uint256", "_openingTime", 1)]
        public BigInteger OpeningTime { get; set; }

        [Parameter("uint256", "_closingTime", 1)]
        public BigInteger ClosingTime { get; set; }
    }
}
